import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Demo from '../components/Demo'

const Router_website = ( { data } ) => {
	return (
		<div>
			<Router>
		      <>
		        <Switch>
			          <Route path="/home">
						<Demo />						
			          </Route>
		        </Switch>
		      </>
		    </Router>
		</div>
	)
}

export default Router_website
